    img: {
      
        height: '300px',
        padding: theme.spacing(4),
    },
  }));

function ErrorMessage() {
    return (
        <>
            <h1 align='center'>Aaaaahnr! Something went wrong. <br />
                We cannot display data.
            </h1>
            <img src={SadStormtrooper} alt="Sad stormtrooper"/>
        </>
    );
}

export default ErrorMessage;
